			shellScript = "#!/bin/sh\n\n# Flutter flavor에 따라 적절한 GoogleService-Info.json 파일을 선택합니다\nGOOGLE_SERVICE_DIR=\"${PROJECT_DIR}/Runner/GoogleService\"\nGOOGLE_SERVICE_DEST=\"${BUILT_PRODUCTS_DIR}/${PRODUCT_NAME}.app/GoogleService-Info.plist\"\n\n# 현재 활성화된 configuration 확인\nCONFIGURATION=$(echo \"${CONFIGURATION}\" | tr '[:upper:]' '[:lower:]')\n\n# flavor에 따라 다른 GoogleService-Info 파일 선택\nif [[ \"${CONFIGURATION}\" == *\"prod\"* ]]; then\n  echo \"Using Production Firebase configuration\"\n  GOOGLE_SERVICE_SRC=\"${GOOGLE_SERVICE_DIR}/GoogleService-Info-prod.plist\"\nelif [[ \"${CONFIGURATION}\" == *\"dev\"* ]]; then\n  echo \"Using Development Firebase configuration\"\n  GOOGLE_SERVICE_SRC=\"${GOOGLE_SERVICE_DIR}/GoogleService-Info-dev.plist\"\nelse\n  # 기본값 설정\n  echo \"Configuration not recognized, using Development Firebase configuration as default\"\n  GOOGLE_SERVICE_SRC=\"${GOOGLE_SERVICE_DIR}/GoogleService-Info-dev.plist\"\nfi\n\n# 파일이 존재하는지 확인하고 복사\nif [ ! -f \"${GOOGLE_SERVICE_SRC}\" ]; then\n  echo \"Error: ${GOOGLE_SERVICE_SRC} does not exist!\"\n  exit 1\nfi\n\necho \"Copying ${GOOGLE_SERVICE_SRC} to ${GOOGLE_SERVICE_DEST}\"\ncp \"${GOOGLE_SERVICE_SRC}\" \"${GOOGLE_SERVICE_DEST}\"\n";
